import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-nav',
  templateUrl: './nav.component.html',
  styleUrls: ['./nav.component.css']
})
export class NavComponent implements OnInit {

  aspNetUserNav: any
  private visible: any;
  ngOnInit(): void {
    this.aspNetUserNav = "";
    this.visible = true;
  }

  getAspNetUser(newAspNetUser: string){
    this.aspNetUserNav = newAspNetUser;
  }

  logout() {

    }
}
<div style="background-color: #f7f8f8;">
  <div class="row" *ngIf="aspNetUserNav == '' ">
      <div class="col"></div>
      <div class="col"></div>
      <div class="col"></div>
      <div class="col d-flex justify-content-end">
        <a class="link-opacity-100" [routerLink]="['login']">Login</a>
      </div>
  </div>
  <div class="row" *ngIf="aspNetUserNav != '' ">
    <div class="col"></div>
    <div class="col"></div>
    <div class="col"></div>
    <div class="col d-flex justify-content-end">
      <a class="link-opacity-100" (click)="logout()">Logout</a>
    </div>
</div>
</div>
